import React from 'react';

const SearchList = (props) => {
    if (results) {
        return (
            <div className="search-list">
                <ul>
                    {props.results.map(result => (
                        <li key={result.imdbID}>{result.Title}</li>
                    ))}
                </ul>
            </div>
        )
    }

}


export default SearchList;
